webpackJsonp([0x1a6b3a6263798000],{"./node_modules/json-loader/index.js!./.cache/json/mathematics-complex-numbers-introduction.json":function(e,n){e.exports={data:{markdownRemark:{html:'<h2>Complex Numbers Introduction</h2>\n<p>A complex number is any number that can be expressed in the form of z = a + ib.</p>\n<p><img src="https://www.codeproject.com/KB/cpp/882975/SquareRoot1.png" alt="i"></p>\n<p> a is called the real part of the complex number, and b is called the imaginary part. </p>\n<h4>Note</h4>\n<p>A pure imaginary number or a pure real number is also a complex number.</p>\n<h4>Examples</h4>\n<ol>\n<li>\n<p>What is the real part of 2i+1?\nA. Real part : 1</p>\n</li>\n<li>\n<p>What is the imaginary part of 2 - 4i?\nA. Imaginary part : -4</p>\n</li>\n<li>\n<p>Is it a complex number z = 2i?\nA. Yes , because we can write this number as z = 0 + 2i.</p>\n</li>\n<li>\n<p>Is it a complex number z = 4?\nA. Yes , because we can write this number as z = 4 + 0i.</p>\n</li>\n</ol>\n<h4>More Information:</h4>\n<!-- Please add any articles you think might be helpful to read before writing the article -->\n<ul>\n<li><a href="https://en.wikipedia.org/wiki/Complex_number">Wikipedia : Complex Numbers</a></li>\n<li><a href="https://www.khanacademy.org/math/algebra2/introduction-to-complex-numbers-algebra-2/the-complex-numbers-algebra-2/a/intro-to-complex-numbers">More Information</a></li>\n</ul>',fields:{slug:"/mathematics/complex-numbers-introduction/"},frontmatter:{title:"Complex Numbers Introduction"}}},pathContext:{slug:"/mathematics/complex-numbers-introduction/"}}}});
